import React, { useEffect, useState } from 'react';

function App() {
  // TODO: set use state inner perens to structure of api
  // TODO: change name to credit card something or another
  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch('/api')
      .then((response) => response.json())
      .then((data) => {
        setBackendData(data);
      });
  }, []);

  return <div>{backendData ? <p>backendData.stringify</p> : '...loading'}</div>;
}

export default App;
